INSERT INTO `prestations` (`id`, `code`, `name`, `slug`, `needOut`, `unite_admin_id`, `entite_admin_id`, `created_at`, `updated_at`, `desc`, `content_type`, `need_meeting`, `need_validation`, `signer`, `start_point`, `delay`, `is_automatic_delivered`, `from_pns`) VALUES
(1, 'PS00036', 'Attestation de non litige', 'attestation-de-non-litige', 1, 1, 1, '2021-05-14 19:14:35', '2024-05-02 14:58:02', '<p>Chers visiteurs, les<strong> attestations de non litige</strong> sont d&eacute;livr&eacute;es par le service des Relations Interprofessionnelles au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez l&#39;attestation de non litige d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 0, 0, 0, 1, 2, 10, 0, 1),
(2, 'PS00564', 'Déclaration d\'établissement', 'declaration-etablissement', 1, 1, 1, '2021-05-17 05:22:13', '2024-01-25 12:15:55', '<p>Chers visiteurs, <strong>la d&eacute;claration d&#39;&eacute;tablissement</strong>&nbsp;sont faites au &nbsp;<strong>Service des Relations Interprofessionnelles</strong> au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>la d&eacute;claration d&#39;&eacute;tablissement</strong> d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 2, 0, 0, 1, 3, 10, 0, 1),
(3, 'PS00565', 'Règlements intérieurs', 'visa-reglement-interieur-entreprise', 1, 1, 1, '2021-05-17 05:22:42', '2024-01-25 12:16:08', '<p>Chers visiteurs, <strong>les&nbsp;d&eacute;livrances de visa sur les r&egrave;glements int&eacute;rieurs d&#39;entreprises</strong>&nbsp;sont faites au &nbsp;<strong>Service des Relations Interprofessionnelles</strong> au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>le document approuv&eacute;</strong>&nbsp;dans votre bo&icirc;te mail.</p>', 1, 1, 1, 1, 3, 10, 0, 1),
(4, 'PS00570', 'Autorisation de licenciement pour motif économique ou motif personnel', 'autorisation-de-licenciement-pour-motif-economique-ou-motif-personnel', 1, 1, 1, '2021-05-17 05:23:02', '2024-01-25 12:16:20', '<p>Chers visiteurs, <strong>les autorisations de licenciement&nbsp;</strong>sont faites au &nbsp;<strong>Service de la m&eacute;diation&nbsp;</strong>au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>l&#39;autorisation de licenciement</strong> d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 0, 1, 0, 1, 35, 10, 0, 1),
(5, 'PS1', 'Autorisation de licenciement pour motif personnel du salarié protégé', 'autorisation-de-licenciement-pour-motif-personnel-du-salarie-protege', 1, 1, 1, '2021-05-17 05:23:18', '2021-06-09 13:12:48', '<p>Chers visiteurs, <strong>les autorisations de licenciement&nbsp;</strong>sont faites au &nbsp;<strong>Service de la m&eacute;diation&nbsp;</strong>au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>l&#39;autorisation de licenciement</strong> d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 0, 0, 0, 0, 0, 0, 0, 1),
(6, 'PS00569', 'Agrément  médecin', 'decision-agrement-exercice-medecin', 1, 1, 1, '2021-05-17 05:23:34', '2024-01-25 12:16:42', '<p>Chers visiteurs, <strong>les d&eacute;livrances de d&eacute;cision d&#39;agr&eacute;ment&nbsp;d&rsquo;exercice en qualit&eacute; de m&eacute;decin d&rsquo;entreprise&nbsp;</strong>sont faites au &nbsp;<strong>Service des Relations Interprofessionelles</strong>au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>la d&eacute;cision d&#39;agr&eacute;ment d&#39;exerciece</strong>&nbsp;d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 0, 1, 1, 16, 33, 10, 0, 1),
(7, 'PS00577', 'Visa de contrat d’apprentissage', 'visa-contrat-apprentisage', 1, 1, 1, '2021-05-17 05:23:52', '2024-01-25 12:16:51', '<p>Chers visiteurs, <strong>le visa de contrat d&#39;apprentissage&nbsp;</strong>est fait&nbsp;au &nbsp;<strong>Service des Relations Interprofessionnelles&nbsp;</strong>au sein de la <strong>Direction G&eacute;n&eacute;rale du Travail (DGT)</strong>. Une fois votre demande soumise, votre dossier sera &eacute;tudi&eacute; et vous recevrez <strong>le document approuv&eacute;</strong>&nbsp;d&eacute;livr&eacute;e dans votre bo&icirc;te mail.</p>', 1, 1, 1, 1, 3, 15, 0, 1),
(8, 'PS2', 'Autorisation de stage', 'autorisation-de-stage', 1, 12, 1, '2021-05-17 05:24:06', '2022-11-08 14:53:43', '<p>Toute&nbsp;demande de stage est faite &agrave; l&#39;endroit du <strong>Minist&egrave;re du Travail et de la fonction Publique</strong> &agrave; l&#39;attention du<strong> Directeur des Administrations&nbsp; et des Finances (DAF)</strong>. Une fois votre demande soumise en ligne, vous recevrez dans les prochains jours par mail, votre <strong>autorisation de stage</strong> dans une des directions du mnist&egrave;re .</p>', 0, 0, 0, 12, 14, 10, 0, 1),
(11, 'PS01181', 'Attestation de service fait / bonne fin d\'exécution', 'attestation-de-service-fait', 1, 8, 1, '2021-05-31 07:15:51', '2024-01-25 12:17:28', '<p>Ce document est d&eacute;livr&eacute; par le<strong>&nbsp;(PRMP) </strong>d&#39;une prestation<strong>&nbsp;</strong>en version pdf&nbsp;.</p>', 0, 0, 0, 8, 9, 10, 0, 1),
(14, 'PS3', 'Attestation de fin de stage', 'attestation-de-stage', 1, 12, 1, '2021-05-31 12:46:21', '2022-12-20 15:20:36', '<p>Ce document est d&eacute;livr&eacute; par le <strong>Directeur des Administrations&nbsp; et des Finances (DAF)&nbsp;</strong>au stagiaire &agrave; la fin de son stage en version pdf sous pr&eacute;sentation de son rapport de stage .</p>', 0, 0, 0, 12, 14, 10, 1, 1),
(17, 'PS4', 'Attestation de présence au poste', 'attestation-de-presence-au-poste', 1, 12, 1, '2021-06-13 10:21:03', '2022-10-20 14:53:37', '<p><strong>En quoi consiste la prestation&nbsp;? :</strong>&nbsp;Pour diverses raisons, l&rsquo;agent peut demander une attestation de pr&eacute;sence au poste.</p>\n\n<p><strong>Quel est l&rsquo;int&eacute;r&ecirc;t pour le demandeur&nbsp;? :</strong>&nbsp;Elle permet &agrave; l&rsquo;agent de justifier sa pr&eacute;sence au poste</p>\n\n<p><strong>Est-elle obligatoire&nbsp;? :</strong>&nbsp;En cas de besoin</p>\n\n<p><strong>A-t-elle une &eacute;ch&eacute;ance &agrave; respecter&nbsp;? :</strong>&nbsp;Oui, il faut un d&eacute;lai de trois jours</p>\n\n<p><strong>Y-a-t-il un int&eacute;r&ecirc;t &agrave; le demander plus t&ocirc;t&nbsp;? :</strong>&nbsp;Oui, afin d&rsquo;obtenir l&rsquo;attestation de pr&eacute;sence au poste dans le d&eacute;lai</p>', 0, 0, 0, 12, 14, 0, 0, 1),
(18, 'PS5', 'Attestation d\'existence', 'attestation-existence', 1, 1, 1, '2021-06-29 08:10:15', '2021-06-29 08:10:15', '<p>Document important</p>', 0, 0, 0, 0, 0, 0, 0, 1),
(19, 'PS6', 'Paiement de cotisation', 'paiement-des-cotisations', 1, 1, 1, '2021-06-29 08:10:15', '2021-06-29 08:10:15', '<p>Document important</p>', 0, 0, 0, 0, 0, 0, 0, 1),
(20, 'PS7', 'Adhésion à la CMPS', 'adhesion-a-la-cmps', 1, 17, 1, '2021-06-29 08:10:15', '2022-10-18 07:24:54', '<p>Document important</p>', 0, 0, 0, 17, 18, 0, 0, 1),
(21, 'PS8', 'attestation-tenant-lieu-de-carte-dimportateur', 'attestation-tenant-lieu-de-carte-dimportateur', 1, 1, NULL, NULL, NULL, '', 0, 0, 0, 0, 0, 0, 0, 1),
(22, 'PS9', 'attestation-provisoire-tenant-lieu-de-carte-professionnelle-de-commercant', 'attestation-provisoire-tenant-lieu-de-carte-professionnelle-de-commercant', 1, 1, NULL, NULL, NULL, '', 0, 0, 0, 0, 0, 0, 0, 1),
