(148, 2, '', '', NULL, NULL, 'Observations :\n- au niveau du titre,  mettre règlement intérieur et non statut et règlement ;\n- au niveau de l\'introduction, préciser que le règlement intérieur énonce les  règles relatives à l’organisation technique du travail, à la discipline et les prescriptions relatives à l’hygiène et à la sécurité nécessaires à la bonne marche de l’entreprise ;\n-  article 1, revoir le titre, préciser au niveau de l\'article que la structure est régi  par le code du travail, la  loi n°2017‐05 du 29 août 2017 fixant les conditions et la procédure d’embauche, de placement de la main‐d’œuvre et de résiliation du contrat de travail en République du Bénin, la convention collective générale du travail et les textes réglementaires y afférents ;\n- préciser dans un article la durée hebdomadaire du travail ;\n- article 12 reformuler le titre comme suit \" assurance maladie et sécurité sociale\", indiquer que les travailleurs bénéficient d\'une assurance maladie ;\n- article 13, point 2 reformuler l\'article conformément aux dispositions en vigueur selon qu\'il s\'agit d\'un CDD ou d\'un CDI ;\n- article 13 point 3 supprimer \"sans motif\" et mettre \" sans paiement d\'indemnité de rupture à l\'exception de l\'indemnité compensatrice de congés payés ;\n- article 14 revoir en vous conformant aux dispositions en vigueur ;\n- article 15, corriger, les sanction disciplinaires sont celles prévues à l\'article 17 de la convention collective générale du travail ;\n- article 16, préciser que la modification est faite par écrit et suivant la même procédure ;\n- article 18, préciser la date d\'entrée en vigueur du règlement intérieur et la formalité de dépôt au niveau du greffe du tribunal de 1ère instance du siège de l\'entreprise ;\n- indiquer de manière expresse dans un articles les interdictions ;\n- prévoir des articles sur les mesures de santé et sécurité au travail ;\n- faire signer le règlement intérieur par l\'employeur ;\n- pour le visa, mettre ce qui suit après la signature de l\'employeur :\n\" Visé et enregistré sous le n°        MTFP/DGT/DRPDS/SRI  du………………………\n\nLe Directeur Général du Travail \"\n-  mettre au moins un article sur la page de signature ;\n- joindre l\'avis des délégués du personnel.\n\n\nEdgard DAHOUI\n\n', NULL, 167, 3, '2024-02-22 11:08:14', '2024-02-22 11:08:14'),
