(151, 2, '', '', NULL, NULL, 'Je vous prie de prendre en compte les observations ci-après:\n-    article 2:  alinéa 3, revoir le délai d\'information de modification de l\'horaire de travail qui paraît assez court;\n                 avant dernier alinéa, reformuler pour plus de compréhension;\n-   article 19 : préciser les fautes pouvant donner lieux à un blâme, une mutation d\'office, une rétrogradation et un licenciement avec préavis.\n-    article 20 : 1ere puce mettre \" demande d\'explication écrite  adressée au travailleur\"; 2e puce reformuler et mettre le 2e phrase au niveau de la première puce.\n-    joindre l\'avis des délégués du personnel.\n-    faire signer le document par l\'employeur.', NULL, 180, 3, '2024-04-30 11:59:38', '2024-04-30 11:59:38'),
