(191, 2, '', '', NULL, NULL, 'OBSERVATIONS\nPage de garde : supprimer \"Projet de\" au niveau du titre;\n- article 4 dernier tiret revoir la date de la convention collective de travail des banques et établissements financiers du Bénin ;\n- article 6, remplacer \"sous réserve de l\'autorisation...communication\" par \" conformément aux dispositions en vigueur\" en raison de ce que l\'autorisation de l\'inspecteur n\'est nécessaire qu\'en cas de dépassement de 240 heures supplémentaires par année et par salariés  ;\n- article 9, -1er alinéa  supprimer la 4è phrase;\n                 - avant dernière phrase, corriger en précisant qu\'il sera accordé au travailleur en congé rappelé, \n                     le nombre de jours travaillés ; \n- article 20 : 2e puce; 3e et 6e tiret, préciser le nombre de jours d\'absence non justifiés ;\n                     puce 2, tiret 4 et puce 4 tiret 1, revoir : l\'insubordination est une faute lourde;\npuce 4 et 5 revoir les fautes tout en évitant les répétitions de part et d\'autres. \n- article 21 : préciser de la procédure disciplinaire commence par une demande d\'explication.\n- l\'article 21 a été répété, revoir la numérotation.\n- 2e article 21  revoir la composition du conseil de discipline en précisant les postes où les fonctions concernés (exemple RH, DAF, le supérieur hiérarchique immédiat...). la disposition un ou plusieurs de la filiale est vague. en ce qui concerne les délégués du personnel, corriger \"du délégué du personnel\" et prévoir un nombre, la structure peut disposer de plus d\'un délégué du personnel ;\narticle 29 supprimer la 1ere phrase, la modification du règlement intérieur suit le même processus.\n- article 30 : préciser la date d\'entrée en vigueur;\n- faire signer le règlement intérieur par l\'employeur ;\n- joindre l\'avis des délégués du personnel.', NULL, 206, 3, '2024-06-11 14:42:10', '2024-06-11 14:42:10'),
(192, 2, '', '', NULL, NULL, 'OBSERVATIONS\nPage de garde : supprimer \"Projet de\" au niveau du titre;\n- article 4 dernier tiret revoir la date de la convention collective de travail des banques et établissements financiers du Bénin ;\n- article 6, remplacer \"sous réserve de l\'autorisation...communication\" par \" conformément aux dispositions en vigueur\" en raison de ce que l\'autorisation de l\'inspecteur n\'est nécessaire qu\'en cas de dépassement de 240 heures supplémentaires par année et par salariés  ;\n- article 9, -1er alinéa  supprimer la 4è phrase;\n                 - avant dernière phrase, corriger en précisant qu\'il sera accordé au travailleur en congé rappelé, \n                     le nombre de jours travaillés ; \n- article 20 : 2e puce; 3e et 6e tiret, préciser le nombre de jours d\'absence non justifiés ;\n                     puce 2, tiret 4 et puce 4 tiret 1, revoir : l\'insubordination est une faute lourde;\npuce 4 et 5 revoir les fautes tout en évitant les répétitions de part et d\'autres. \n- article 21 : préciser de la procédure disciplinaire commence par une demande d\'explication.\n- l\'article 21 a été répété, revoir la numérotation.\n- 2e article 21  revoir la composition du conseil de discipline en précisant les postes où les fonctions concernés (exemple RH, DAF, le supérieur hiérarchique immédiat...). la disposition un ou plusieurs de la filiale est vague. en ce qui concerne les délégués du personnel, corriger \"du délégué du personnel\" et prévoir un nombre, la structure peut disposer de plus d\'un délégué du personnel ;\narticle 29 supprimer la 1ere phrase, la modification du règlement intérieur suit le même processus.\n- article 30 : préciser la date d\'entrée en vigueur;\n- faire signer le règlement intérieur par l\'employeur ;\n- joindre l\'avis des délégués du personnel.', NULL, 206, 3, '2024-06-11 14:42:10', '2024-06-11 14:42:10'),
(193, 2, '', '', NULL, NULL, 'Je vous prie de prendre en compte les observations faites antérieurement.\n', NULL, 213, 3, '2024-06-24 09:56:14', '2024-07-10 10:21:40'),
(194, 2, '', '', NULL, NULL, 'pièces non conformes\njoindre le règlement intérieur objet d\'étude.', NULL, 216, 3, '2024-06-24 09:59:05', '2024-06-24 09:59:05'),
(195, 2, '', '', NULL, NULL, 'Observations : \n- Préambule, 3e alinéa : chaque entreprise doit avoir son règlement intérieur ;\n                        4e alinéa : revoir le règlement intérieur est complété ou modifié suivant la même procédure ; \n- article 1, 4e tiret : justifier l\'opportunité d\'une telle pièce ;\n- article 3, puce 4 : mettre 03 jours et  non 02 jours\n - article 9, 9e puce et article 10, 6e puce : reformuler pour plus de compréhension sur l\'interdiction, pourquoi interdire des messages de masses entre travailleurs ?\n - article 14, supprimer tirets 4, 5, 6 et 7, mettre à l\'avant dernier tiret \"le licenciement avec préavis\" et au dernier tiret, \"le licenciement sans préavis en cas de faute lourde\"; \n-article 15 , alinéa 3: supprimer \"30 minutes par jour soient\" ,  remplacer le groupe de mots \" pour l\'ensemble des délégués\" par \"chacun\";\n              le dernier alinéa n\'a pas de rapport avec le titre de l\'article, il est indiqué d\'en faire un article à part ; \n- article 18, reprendre la grille des fautes et sanctions et prendre en compte toutes les sanctions retenues à l\'article 14 ;\n - article 19, corriger les 1ère et 2ème puces comme suit \" demande d\'explication adressée au travailleur ou une convocation à un entretien. Le travailleur peut se faire assister par un délégué du personnel ou un travailleur de son choix appartenant à l\'entreprise. Il dispose d\'un délai maximal de 48 heures, à compter de la notification de la demande d\'explication, pour apporter sa réponse\"; \n- article 20, alinéa 4, 2ème ligne: remplacer \"votre\" par \"son\" ;\n- préciser la date d\'effet du règlement intérieur qui doit être postérieur d\'au moins deux (02) mois à la date de saisine de l\'inspecteur du travail ; ', NULL, 217, 3, '2024-06-25 08:16:26', '2024-06-25 08:16:26'),
