(296, 2, '', '', NULL, NULL, 'Observations :\n- I-2 revoir les horaires de travail qui excèdent 40 heures par semaine ;\n-III-3 revoir les phrases pour plus de compréhension,  dernière phrase, préciser \"En cas de perte d’un outil de travail du fait du travailleur\";\n- IV : préciser les grilles de sanctions ;\n- préciser la date d\'effet du règlement intérieur qui doit être postérieur d\'au moins deux mois à la saisine de l\'inspection du travail ;\n- joindre l\'avis des délégués du personnel ;\n- faire signer le règlement intérieur par l\'employeur et mettre le cachet de la structure.\n', NULL, 311, 3, '2024-12-26 12:29:24', '2024-12-26 12:29:24');
