(297, 2, '', '', NULL, NULL, 'Observations :\n- Art 4, supprimer ou revoir le dernier alinéa en ce sens que la durée hebdomadaire de travail du personnel administratif ne peut être de 42 heures ;\n- Art 5, corriger et préciser que les heures supplémentaires sont celles effectuées au delà de la durée hebdomadaires de travail normale ;\n- Art 8, revoir le dernier alinéa. en cas de refus, il est fait appel aux forces de l\'ordre pour le contrôle, la personne n\'est pas pour autant suspecte ;\n- corriger la date d\'effet du règlement intérieur qui doit être postérieure d\'au moins deux (02)mois à la saisine de l\'Inspection du travail ;\n- Joindre l\'avis des délégués du personnel.', NULL, 341, 3, '2024-12-27 08:51:14', '2024-12-27 08:51:14'),
