(141, 'PS00928-231009-EEnXZF', 1, 1, 1, 1, 'nvincedenakpo@gmail.com', 0, '6526688e2349d.pdf', NULL, 8, '97447799', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"c7d42fba-f8f9-48c7-b4bc-fa17b8681658\", \"response-token\": \"cISfp-O9SS6DmhFgbdRwgC3eOqpt29Zj3er7DsxzapKSdXBgK0YsiGcZ-rj-xDDOf_EUGIByfSpmvk1pRyGiMw==\"}', 'https://service-public.bj/api/portal/shared/files/ewd2GzCbsKHLyNhJLkj56tjND2i7ztTvrLZHA5Vttplxs9bRj3tNX4qTkGIvhu0zMCsY7z5WOozO_SWYPpgdZQ==', NULL, '<div style=\"margin-top: 15px; \">\r\n                <p class=\"\"><span class=\"mtab\"></span> Monsieur/Madame, denakpo vincent n. </p>\r\n                <p>\r\n                    <span class=\"mtab\"></span>    J\'accuse réception de votre demande de stage  professionnel ci-dessus mentionnée et vous notifie mon accord de principe pour le déroulement dudit stage au sein de la null, afin de vous permettre de confronter vos connaissances théoriques à celles pratiques.\r\n                </p>\r\n            </div>\r\n  \r\n            <div style=\"margin-top: 15px; \">\r\n                    <p>\r\n                        <span class=\"mtab\"></span> Ce stage bénévole de (03) mois qui s\'effectuera du 01 janvier 1970 au 01 janvier 1970 n\'ouvre pas droit à un recrutement dans la fonction publique et ne vous confère pas la qualité d\'agent d\'état.</p>\r\n            </div>\r\n           \r\n            <div style=\"margin-top: 15px; \">\r\n                   <p> <span class=\"mtab\"></span> Recevez, Madame / Monsieur mes meilleures salutations.</p>\r\n            </div>', NULL, NULL, 0, '2023-10-09 13:43:28', '2023-10-11 09:19:10', 7, NULL),
