(144, 'PS00565-231016-lCwaH7', 0, 0, 1, 0, 'b.adjiha@somayafbenin-sa.com', 1, NULL, NULL, 3, '65623331', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"c5cf0aa0-2dda-4b33-8ece-fd0795bc4681\", \"response-token\": \"75xX4R_g4s5xtWrBPThnQbSpr2yUvMtEAEFimZbav4onMWWnzuyNIgPVVoZmYgCtFYey9NBsbt2BLKYIMaNmBA==\"}', 'https://service-public.bj/api/portal/shared/files/GfU1r1kvlhdVhVa4y6nr5INDnb29O6QsWFakvrQsGESSkJl4K2y6Yf0uDKwMotWriKP15-gH2KMIkqV6GgIjMg==', 'les observations n\'ont pas été prises en compte, je vous prie de bien vouloir corriger le règlement intérieur pour apposition du visa sollicité :\n\n* Article 10 : page 9 Puces 2 et 3, enlever les points et mettre les phrases en aliéna à la fin de l\'article en ce sens que ces points ne sont pas des cas de fautes lourdes ; revoir les deux dernières puces pour être en harmonie avec la phrase en début de l\'article ;\n* Article 11 : supprimer ou nuancer, il peut exister des cas où la responsabilité de l\'employeur sera engagée ;\n* Article 15 : préciser la date de saisine de l\'Inspection du Travail, et celle d\'entrée en vigueur du règlement intérieur qui doit être postérieur d\'au moins deux (02) mois à la date de saisine de l\'Inspection du travail ;\n* Présenter le visa comme suit :\n\" visé et enregistré sous n°             MTFP/DGT/DRPDS/SRI du ...........\n\n                    La Directrice Générale du Travail\n\n\n                    Mireille C. LEGBA ADANKON \"', NULL, NULL, NULL, 0, '2023-10-16 13:37:42', '2023-10-26 08:02:23', 2, NULL);
