(145, 'PS00565-231018-n7wU8C', 0, 0, 1, 0, 'a.chancoco@sonimexbenin.com', 0, NULL, NULL, 3, '95381912', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"ae6560d2-a3ee-4e9d-bc74-7cf2e45ecd39\", \"response-token\": \"_5ASwTagUQDE6vL2VOPIuOnM4ya3HA_Qa-vp1_sTnGWO7o5q956gZxfLQ2nZBIf65yO-FiV8jnirAsoh1r3YGQ==\"}', 'https://service-public.bj/api/portal/shared/files/0wDOTgU5AEhvhae3m8nBOHr6QTm1qzMi6LtJeRd8IFLb4b4CBUheezthkpytRTKJ8bAFS4hPapmS_ubYTdRcjw==', 'Observations:\n- faire signer le règlement intérieur par l\'employeur et soumettre la version PDF;\n- Article 1 :\n     * revoir l\'horaire de travail qui excède 40 heures de travail par semaine ; \n      * corriger le contenu la puce intitulé \" Samedi et jours fériés\", les jours fériés ne sont pas considérés comme des jours de travail. Lorsqu\'ils sont déclarés chômés, ils sont sensés non travaillés mais payés. Reformuler aussi la dernière phrase de cette partie ;\n- Article 4 : enlever la précision de CDD d\'un an ou CDI ;\n- Article 5 : reformuler la puce 11 comme suit \" de refuser un travail commandé par un supérieur hiérarchique qui relève de ses attributions, et correspondant à sa qualification\" ; mettre au niveau de l\'avant dernier puce \" de manquer de respect aux clients....\"\n- Article 13 : supprimer \"à\" et \"à droit à\" respectivement au niveau des points 1 et 2;\n- Article 15: remplacer le point licenciement par les points ci après:\n       *  le licenciement avec préavis ;\n       *  le licenciement sans préavis en cas de faute lourde sous réserve de l’appréciation de la juridiction compétente en ce qui concerne la gravité de la faute.\n- Article 16 : revoir la date d\'affichage du règlement intérieur, l\'Inspecteur du Travail délivre, conformément à l\'article 138 du code du travail, le visa dans un délai d\'un mois. De même le règlement intérieur est affiché après le dépôt de deux exemplaires au greffe du tribunal de première instance du siège de l’entreprise.\nSupprimer après la date d\'entrée en vigueur, la portion de phrase \" soit un mois plus tard\".\n- Joindre l\'avis des délégués du personnel élus (s\'il en existe au sein de la structure).', NULL, NULL, NULL, 0, '2023-10-18 06:38:14', '2024-02-12 10:10:10', 1, NULL),
