(204, 'PS00928-240506-cw3B5E', 0, 0, 1, 0, 'chrishouenou32@gmail.com', 0, '6661b293d1007.pdf', NULL, 8, '97417771', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"c46ed803-9657-497a-ac65-7d9f2826b984\", \"response-token\": \"j7iaOpy1cwD67d0F9KkNso8XF0nMXDZTLLkUNYHPbzi6f4Qho3ynbcZ4ADe3MGfndTj-WhKwsNkn67stFKg9HA==\"}', 'https://service-public.bj/api/portal/shared/files/zQa6ZLW-Xrhcc1rwUkyA43JX8aNiGGy8zER6MPNMb2B1kd0h5vJXu2R-EqheWjWs4Ti9Dt5goQonvHc8ANPHbA==', NULL, '<div>&#10;                <p class=\"\"><span class=\"mtab\"></span> Monsieur/Madame, Christ Steeve HOUENOU </p>&#10;                <p><br></p><h4><span lang=\"FR\"><span>J\'accuse r&#233;ception de votre demande de stage professionnel ci-dessus mentionn&#233;e et vous notifie mon accord de principe pour le d&#233;roulement dudit stage</span>&#160;durant la p&#233;riode de&#160;<b>trois</b> <b>(03) mois</b> allant&#160;</span><span lang=\"FR\">du l<b>undi 10 juin au lundi 9&#160;septembre 2023</b><span>&#160;&#224;&#160;la Direction des Syst&#232;mes d\'Information du MTFP.<br><b></b></span></span><span lang=\"FR\">&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#160;&#10;Ce stage permettra &#224; l&#8217;int&#233;ress&#233; d&#8217;acqu&#233;rir des connaissances&#10;compl&#233;mentaires indispensables &#224; la consolidation de sa formation.<br></span><span lang=\"FR\">Je tiens &#224; rappeler que l&#8217;autorisation&#10;qui vous est accord&#233;e d&#8217;effectuer le pr&#233;sent stage, ne saurait &#234;tre assimil&#233;e &#224;&#10;un recrutement dans la fonction publique.<br></span><span lang=\"FR\">En cons&#233;quence, vous serez lib&#233;r&#233; au terme de votre stage.</span></h4><p>&#10;&#10;&#10;&#10;&#10;&#10;</p><p><br></p></div><div>&#10;            </div>&#10;', NULL, NULL, 0, '2024-05-06 01:18:56', '2024-06-06 12:59:00', 1, NULL),
(205, 'PS00928-240506-CxqsGE', 0, 0, 1, 0, 'syevedobarnabe@gmail.com', 0, NULL, NULL, 8, '229 96 053 732', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"1a049c1e-51c2-426b-bde8-64c09c3ef3d1\", \"response-token\": \"p0LykodYxDpjb1_6vNmOCa-KJA3Nhze4kmUzMXNNO6IIY0ACpt2zx8Db7ze98G8wRIbr7SFpFRzaRWZ9vefuog==\"}', 'https://service-public.bj/api/portal/shared/files/vGEdjRCXMHymMlrdP7S2XuhjkifEL3xL4DfuK5McOV9_qljvOp3CmVBBj2RVsxLHvoEjq79Q_V8HT6pryTh4Eg==', NULL, NULL, NULL, NULL, 0, '2024-05-06 22:39:26', '2024-06-06 13:02:44', 1, NULL),
(206, 'PS00565-240508-kTb1db', 0, 0, 1, 0, 'maroxane@sonibank.com', 1, NULL, NULL, 3, '60600796', 0, '{\"uxp-client\": \"BJ/GOV/PNS/PORTAIL\", \"uxp-service\": \"BJ/GOV/PNS/PRE-PROD-PORTAIL/mtfp/v1\", \"application-id\": \"020165f1-e837-4061-9f7c-597d1860a1bf\", \"response-token\": \"0e-Adugin7DCHFlKrvZV3DyuYUs8Q-ZYKooICU8YOeV67urRg6od-SWnyG3FK9t2MAiBZN7OeLcdeJnf4iH8kw==\"}', 'https://service-public.bj/api/portal/shared/files/BAK58LjZuwF_3Z9Wt2prs5Cl-c4TRsjjeA3AxJtM22fbIHveKuOpr6fD0KEHoXlpt6xIjZEtBkXXq7OL8vSfsw==', 'OBSERVATIONS\nPage de garde : supprimer \"Projet de\" au niveau du titre;\n- article 4 dernier tiret revoir la date de la convention collective de travail des banques et établissements financiers du Bénin ;\n- article 6, remplacer \"sous réserve de l\'autorisation...communication\" par \" conformément aux dispositions en vigueur\" en raison de ce que l\'autorisation de l\'inspecteur n\'est nécessaire qu\'en cas de dépassement de 240 heures supplémentaires par année et par salariés  ;\n- article 9, -1er alinéa  supprimer la 4è phrase;\n                 - avant dernière phrase, corriger en précisant qu\'il sera accordé au travailleur en congé rappelé, \n                     le nombre de jours travaillés ; \n- article 20 : 2e puce; 3e et 6e tiret, préciser le nombre de jours d\'absence non justifiés ;\n                     puce 2, tiret 4 et puce 4 tiret 1, revoir : l\'insubordination est une faute lourde;\npuce 4 et 5 revoir les fautes tout en évitant les répétitions de part et d\'autres. \n- article 21 : préciser de la procédure disciplinaire commence par une demande d\'explication.\n- l\'article 21 a été répété, revoir la numérotation.\n- 2e article 21  revoir la composition du conseil de discipline en précisant les postes où les fonctions concernés (exemple RH, DAF, le supérieur hiérarchique immédiat...). la disposition un ou plusieurs de la filiale est vague. en ce qui concerne les délégués du personnel, corriger \"du délégué du personnel\" et prévoir 